import React from "react";
import "./Navbar.css"

const Navbar = () => {
    return (
        <div className="navbar">
          <div className="container">
            <div className="logo">Logo</div>
            <div className="links">Links</div>
          </div>
        </div>
    )
}

export default Navbar
